Błąd podczas wczytywania oryginalnych plików gry, nie można załadować pliku: {0}
Oryginalne pliki zostały prawdopodobnie zmodyfikowane, cofnij wszystkie modyfikacje i spróbuj ponownie. Najlepiej usunąć folder 'SpaceEngineers\Content\Data' a potem wybrać w Steam 'Sprawdź spójność plików gry'.
Przeinstalowanie czasami nie pomaga, ponieważ steam nie usuwa nieznanych plików!
